import React, { useState } from "react";

export default function Comp1() {
  const [dataarray, setdataarray] = useState([
    { Nom: "youssef", prenom: "boughanem", age: "21ans" },
    { Nom: "mohamed", prenom: "elmrini", age: "21ans" },
    { Nom: "yassine", prenom: "ziat", age: "21ans" },
  ]);

  return (
    <div>
      <h1>Liste des etudiants</h1>

      {dataarray.map((el) => {
        return;
        <tr>
          <th>Nom</th>
          <td>{el.Nom}</td>
          <th>prenom</th>
          <td>{el.prenom}</td>
          <th>Age</th>
          <td>{el.age}</td>
        </tr>;
      })}
    </div>
  );
}
